  [],\n\t\"revision_timestamp\": \"2016-07-27T22:18:27.641976\",\n\t\"name\": \"washoe-county-regional-water-supply-and-quality-study-phase-ii-final-report\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The major goal of this study was to help
  structure a solution to the fragmented responsibilities for conservation, resource
  management, water supply, wastewater, flood control, and water quality in the Truckee
  River Basin. This Regional Water Supply and Quality Study provides the framework
  for future resource management action capital improvements and management actions
  through the year 2012. It represents a point from which facility planning and implementation
  of specific capital improvements can be undertaken. This study sets forth an ambitious
  plan of capital improvements and management actions. The fundamental goal of this
  program is to more effectively manage and protect the region's water resources to
  the benefit of all water users in the Truckee River Basin. The goals of the study
  are consistent with those of the Truckee Meadows Regional Plan.\",\n\t\"license_title\":
